INSERT INTO `Nyhet` VALUES 
(2,'<h2><u>Regelendringer fra forbundet 2006-2007</u></h2><p>Sjå her no <a href=\"http://www.ril-hockey.no/Regelendringer_2006-2007.pdf\" target=\"_self\">http://www.ril-hockey.no/Regelendringer_2006-2007.pdf</a></p>','J','2006-08-13 18:56:28'),
(19,'<p>SESONGAVSLUTNING !!!!</p><p>En fremgangsrik sesong for klubben over alle klubber markeres med \"fest\" fredag 13 april kl 1900 på lokalet i Dynekilgata. Det blir servert øl og pizza. Egenandel kr. 100,-. Festen inkluderer både A-laget og Old-Boys laget. Påmelding til undertegnede innen fredag 30 mars. Ta gjerne med medbrakt for de som ønsker det !</p><p>VEL MØTT !!!!!!!!!!!</p><p>Rune og Per</p><p></p>','J','2007-03-20 08:53:04'),
(6,'<p>Norgesmestre jr. 1962 !</p><p>Rosenhoff er en gammel ærverdig klubb med tunge tradisjoner. Gå inn på \"bilder\" og se på gutta som ble Norgesmestre for Rosenhoff i 1962.</p><p>RS</p>','J','2006-08-30 06:56:33'),
(16,'<p>Poengstatistikk</p><p>Sesongens målscorer er Pekka K med 34 poeng. Vi gratulerer.  Etterfulgt av Tuomas med 21. Beste \"nordmann\" er Bjørn \"Humba\" Haakenstad på delt 3 plass med 13 poeng sammen med Pekka N. Videre fulgte Jon med 10 poeng, Anders med 9 og Petrus med 8.</p><p>RS</p>','J','2007-03-08 07:53:11'),
(18,'<p>SERIEMESTERE SESONGEN 2006/2007</p><p>Etter å ha tapt seriemesterskapet i fjor på innbyrdes oppgjør, var det etter 5-2 seier over Mølla i siste seriekamp spesielt tilfredsstillende å kunne gå av banen som seriemestere sesongen 06/07. Fraværet av vår storscorer Pekka Koivisto var merkbart, og det var ikke før i 3.periode at vi avgjorde det hele til vår fordel mot et Mølla som gjorde alt i sin makt for å forhindre at seriemesterskapet havnet hos laget fra området mellom Trondheimsveien og Torshovdalen. Tusen takk til samtlige for en strålende sesong. Spesielt takk til våre utmerkede Finner som har vært sterkt delaktige i at vi kan krone oss med tittelen \"Seriemestre 06/07\".</p><p>RS</p><p></p>','J','2007-03-08 08:09:59'),
(23,'<p>GRATULERER !</p><p>Rune (Olsen) har blitt pappa til ei lita jente. Rosenhoff gratulerer !!!!</p>','J','2007-05-31 11:23:22'),
(21,'<p>Klubbens lokale i Dynekilgata.</p><p>Klubben har siden 1934 disponert samme lokale i Dynekilgata på Rosenhoff. Klubbens totale utgifter til husleie, strøm og forsikring  balanserer ikke i forhold til hva hovedlaget har i inntekter. Dette er et regnestykke som på sikt vil ende opp med røde tall og egenkapital i null. Hovedstyret i klubben har imidlertid fått en henvendelse fra styret i borettsslaget som \"eier\" lokalet, hvor de ønsker å overta dette med tanke på å gjøre det om til leilighet. Som en kompensasjon for dette vil klubben få adgang til boretsslagets eget utleielokale på samme vilkår som borettslagets egne medlemmer. Vi vil slippe samtlige utgifter til leie, strøm osv samtidig som vi har fått adgang til å plassere klubbens premieskap, bilder osv inn i det nye lokalet.</p><p>Etter alt å dømme vil vi velge å gå for denne løsningen og håper på å være \"etablert\" i det nye lokalet om ikke alt for lenge. Samtlige medlemmer må i denne forbindelse være forberedt på en liten dugnad i forhold til å avvikle lokalet og samtidig bidra til å flytte inn i det nye !!!</p>','J','2007-05-02 07:20:53');

